import './App.css';
import { Routes, Route } from "react-router-dom";

import CategoryList from './Shared/CategoryList';
import FormList from './Shared/FormList';
import NotFound from './Shared/Errors/NotFound';
import FormBase from './Shared/FormBase';
import PageBase from './Shared/PageBase';

function App() {
    return (
        <main className="App" id="main" class="sectionOne">
            <div class="container-fluid">
                <div class="row">
                    <div class="col-md-8">

                        <Routes>
                            {/* same file? just CategoryList? */}
                            <Route exact path="/" element={<CategoryList />} />

                            <Route exact path="/" element={<CategoryList />} >
                                <Route path="/Categories/:category" element={<FormList />} />
                            </Route>

                            <Route path=":form" element={<FormBase />}>
                                <Route path=":page" element={<PageBase />} />
                            </Route>

                            <Route path="/ErrorNotFound" element={<NotFound />} />
                            <Route path="/ErrorGeneric" element={<NotFound />} />
                            <Route path="/ErrorPageExpired" element={<NotFound />} />
                            <Route path="/ErrorNotFound" element={<NotFound />} />
                            <Route path="*" element={<NotFound />} />
                        </Routes>

                    </div>

                    <div class="col-md-4">

                    </div>
                </div>
            </div>
        </main>
    );
}

export default App;
